class Homepage extends Component {

  constructor(props){
    super(props)
    this.state = {
      display: false
    }

  }

  toggleDisplay = () => {
	 this.setState({
      display: true
     })
  }

	render() {
		return(
			<div className= "homepage"> 
				<br />
				<br />
				<br />
				<h1>My Website</h1>
				<br />
				<br />
				<br />
				<div className = "flex">
					<Featured/>
				</div>
				<MoreInfo/>
				<br />
				<br />
				<br />
				<Links/>
			</div>
		)
	}
}

export default Homepage
